import React from "react";

class CP extends React.Component {
    render() {
        return (

             <div>

                <div class="w3-container w3-xlarge w3-green w3-shadow w3-hide-small">
                    <div class="w3-center"><h1 style="margin-top:30px;margin-bottom:20px;">Choose a country recipe page</h1></div>
                </div>

                <div id="projects" class="w3-hide-medium w3-hide-small">
                    <ul>
                    <li><a href="spain_new.html"><img src="img/flag_s.png" alt=""/></a></li>
                    <li><a href="#"><img src="img/flag_f.jpg" alt=""/></a></li>
                    <li><a href="#"><img src="img/flag_g.png" alt=""/></a></li>
                    <li><a href="#"><img src="img/flag_d.jpg" alt=""/></a></li>
                    <li><a href="#"><img src="img/flag_p.jpg" alt=""/></a></li>
                    <li><a href="#"><img src="img/flag_k.png" alt=""/></a></li>
                    </ul>
                </div>

             </div>
        );
    }
}

export default CP;
